catch(error){Disponible = MSG(false);}

return [Nombre,ALS,Variador,Sensor,Disponible];

function MSG(message){
    return {payload: message}
}

var event   = flow.get('Events')||[];
var id      = flow.get('id')||0;
var date    = new Date();

// Date
var year    = date.getFullYear();
var month   = date.getMonth()+1;
var day     = date.getDate();

//Time
var hours   = date.getHours();
var minutes = date.getMinutes();
var seconds = date.getSeconds();

msg.payload={
            'no':id,
            'fecha':month+'/'+day+'/'+year,
            'hora':hours+':'+minutes+':'+seconds,
            'evento':msg.payload
}

// Adjuntar evento
event.unshift(msg.payload);

// Limitar número de eventos
event = event.slice(0,99);

// Guardar eventos en el contexto
flow.set('Events',event);

// incrementar ID de evento
id++

// Reiniciar ID
if(id==1000){id=0;}
flow.set('id',id);

msg.payload = event;
return msg;

